import { useSelector } from "react-redux";

function App() {

  const counter = useSelector(state => state.counter);

  return (
    <div className="App">
      <h1>Count : {counter} </h1>
      <button>+</button>
      <button>-</button>
    </div>
  );
}

export default App;
